desc:
Nestled in a wide tree-lined street behind a pretty picket fence, this captivating three bedroom family home is impressively situated in the coveted and prestigious Mar Lodge estate. Reminiscent of a bygone era are the ornate Art Deco ceilings and picture rails feature in this immaculate home. Comprising of; 
- Three generous bedrooms, Master with built in robe 
- Formal lounge with a stunning bay
